insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (1, 'Tom Hooper' , 'https://es.web.img2.acsta.net/r_1920_1080/pictures/15/08/07/23/02/408747.jpg' , 'Britanica' , '1972-10-05' , 'Thomas George -Tom- Hooper es un director, guionista y productor británico, ganador de un Óscar. Su película El discurso del rey ganó cuatro premios Óscar, entre ellos mejor director y mejor película.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (2, 'David Fincher' , 'https://resizing.flixster.com/2UNYJafA1F4MHYxudpzqeT37gZE=/218x280/v2/https://flxt.tmsimg.com/assets/74061_v9_ba.jpg' , 'Estado Unidense' , '1962-08-28' , 'David Andrew Leo Fincher, conocido como David Fincher, es un director y productor estadounidense de cine, televisión y vídeos musicales. Fue nominado para el Óscar a mejor director por El curioso caso de Benjamin Button, La red social y por Mank.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (3, 'Ryusuke Hamaguchi' , 'https://images.mubicdn.net/images/cast_member/373860/cache-128353-1454441506/image-w856.jpg?size=240x' , 'Japonesa' , '1978-12-16' , 'Ryusuke Hamaguchi is a Japanese film director and screenwriter. An alumnus of the University of Tokyo and the Tokyo National University of Fine Arts and Music, he started getting attention in his home country with the graduate film Passion (2008).');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (4, 'Bong Joon-ho' , 'https://images.mubicdn.net/images/cast_member/4836/cache-617588-1607417988/image-w856.jpg?size=240x' , 'Surcoreana' , '1969-09-14' , 'Bong Joon-ho es un director de cine y guionista surcoreano. Entre sus trabajos cinematográficos figuran Memorias de un asesino (2003), la película de monstruos The Host (2006), la película de ciencia ficción Snowpiercer (2013).');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (5, 'Larry y Andy Wachowski' , 'https://gcdn.emol.cl/cine/files/2017/12/hermanos-wachowski-antes.jpg' , 'Estadounidenses' , '1965-06-21' , 'Larr y Andy Wachowski (ahora conodicas como Lana y Lilly Wachowski) nacieron y fueron educadas en Chicago, comenzando con una carpintería mientras creaban cómics en su tiempo libre.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (6, 'Damien Chazelle' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/Damien_Chazelle_in_NYC%2C_2018_%28cropped%29.jpg/800px-Damien_Chazelle_in_NYC%2C_2018_%28cropped%29.jpg' , 'Estadounidesne' , '1985-01-19' , 'Damien Sayre Chazelle es un director, guionista y productor de cine estadounidense y francés. Dirigió y escribió Whiplash y La La Land, estrenadas en 2014 y 2016, así como First Man en 2018.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (7, 'James Cameron' , 'https://static.wikia.nocookie.net/doblaje/images/8/83/James_Cameron.jpg/revision/latest/scale-to-width-down/333?cb=20211101064107&path-prefix=es' , 'Canadiense' , '1954-08-16' , 'James Francis Cameron es un director, guionista, productor de cine, editor de cine, ingeniero, filántropo y explorador marino canadiense..');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (8, 'David Yates' , 'https://es.web.img3.acsta.net/pictures/18/11/09/09/30/5964618.jpg' , 'Britanica' , '1963-10-08' , 'David Yates es un director, guionista y productor de cine y televisión británico que ha desarrollado una larga carrera televisiva en su país, principalmente concretando diferentes trabajos para la cadena BBC.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (9, 'Ryan Coogler' , 'https://upload.wikimedia.org/wikipedia/commons/4/44/Ryan_Coogler_%2836203771036%29_2.jpg' , 'Estadounidense' , '1986-05-23' , 'Ryan Kyle Coogler es un director y guionista estadounidense. Es conocido en la industria por su trabajo como director de las películas Creed y Black Panther.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (10, 'Jennifer Lee y Chris Buck' , 'https://www2.pictures.zimbio.com/gi/Premiere+Walt+Disney+Animation+Studios+Frozen+sijRQHu_bX-x.jpg' , 'Estadounidenses' , '1971-10-21' , 'Jennifer Michelle Lee es una guionista, directora y productora estadounidense, conocida por ser la directora y guionista de la película Frozen, con la que ganó el Óscar a mejor película animada..');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (11, 'Anthony y Joe Russo' , 'https://hips.hearstapps.com/es.h-cdn.co/fotoes/images/noticias-cine/los-hermanos-russo-dirigiran-los-vengadores-3-infinity-war/45527073-1-esl-ES/Los-hermanos-Russo-dirigiran-Los-Vengadores-3-Infinity-War.jpg' , 'Estadounidenses' , '1970-02-03' , 'Anthony Russo (n. 3 de febrero de 1970) y Joseph V. Russo (n. 18 de julio de 1971) son dos hermanos directores, productores, guionistas.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (12, 'Colin Trevorrow' , 'https://static.wikia.nocookie.net/esstarwars/images/6/6a/Colin_Trevorrow.jpg/revision/latest/scale-to-width-down/350?cb=20200909181002' , 'Estadounidense' , '1976-09-13' , 'Colin Trevorrow es un director y guionista de cine estadounidense, conocido por su trabajo en la película de 2012 Safety Not Guaranteed y en la cuarta entrega de la franquicia de Jurassic Park: Jurassic World.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (13, 'J. J. Abrams' , 'https://static.wikia.nocookie.net/esstarwars/images/5/54/JJ_Abrams.jpg/revision/latest?cb=20130128212406' , 'Estadounidense' , '1966-06-27' , 'Jeffrey Jacob Abrams, más conocido como J. J. Abrams, es un director, productor, guionista, actor y compositor de cine y televisión estadounidense. Es propietario de la productora de cine Bad Robot Productions.');
insert into DIRECTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (14,'William Wyler','https://upload.wikimedia.org/wikipedia/commons/c/cd/William_Wyler_portrait.jpg','Suizogermanoestadounidense','1902-07-01','William Wyler was a Swiss-German-American film director and producer who won the Academy Award for Best Director three times, those being for Mrs. Miniver (1942), The Best Years of Our Lives (1946), and Ben-Hur (1959), all of which also won for Best Picture. In total, he holds a record twelve nominations for the Academy Award for Best Director.');
