insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (2, 'Geoffrey Rush' , 'https://cdn.britannica.com/08/147808-050-A366AEA3/Geoffrey-Rush-2010.jpg' , 'Australiana' , '1951-07-06' , 'Geoffrey Roy Rush, conocido como Geoffrey Rush, es un actor australiano multipremiado. Conocido por interpretar al capitán Hector Barbossa en las cinco películas de Piratas del Caribe, Lionel Logue en El discurso del rey.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (3, 'Helena Bonham Carter' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/6e/Helena_Bonham_Carter_2011_AA.jpg/640px-Helena_Bonham_Carter_2011_AA.jpg' , 'Britanica' , '1966-05-26' , 'Helena Bonham Carter es una actriz británica, ganadora del premio BAFTA, y dos veces nominada a los Premios Óscar Hizo su debut como actriz en una adaptación para .');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (4, 'Guy Pearce' , 'https://resizing.flixster.com/TNqXJT4tGUoCKg-Gg1T2BLFVfr0=/218x280/v2/https://flxt.tmsimg.com/assets/74054_v9_bc.jpg' , 'Britanica' , '1967-10-05' , 'Guy Edward Pearce, conocido como Guy Pearce, es un actor australiano nacido en el Reino Unido. Su primer éxito en el cine fue actuando en Las aventuras de Priscilla, reina del desierto en 1994.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (5, 'Jennifer Ehle' , 'https://static.wikia.nocookie.net/shadowhunters/images/0/01/Jennifer_Ehle_2017.jpg/revision/latest/scale-to-width-down/180?cb=20170924212824&path-prefix=es' , 'Estadounidense' , '1929-12-29' , 'Jennifer Ann Ehle es una actriz estadounidense de teatro y cine. Es conocida por su papel como Elizabeth Bennet en la mini-serie Pride and Prejudice.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (6, 'Rosamund Pike' , 'https://es.web.img3.acsta.net/c_310_420/pictures/15/07/24/10/05/242676.jpg' , 'Britanica' , '1979-01-20' , 'Rosamund Mary Ellen Pike, más conocida como Rosamund Pike, es una actriz de cine y televisión británica.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (7, 'Emily Ratajkowski' , 'https://media.vogue.mx/photos/62c6d2bd348fa52aeb48e7bf/2:3/w_1920,c_limit/GettyImages-1403883831.jpg' , 'Britanica' , '1991-06-07' , 'Emily Ratajkowski es una modelo, empresaria y actriz estadounidense.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (8, 'Ben Affleck' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/Ben_Affleck_by_Gage_Skidmore_3.jpg/1200px-Ben_Affleck_by_Gage_Skidmore_3.jpg' , 'Estadounidense' , '1972-08-15' , 'Benjamin Géza Affleck-Boldt, conocido simplemente como Ben Affleck, es un actor, director, productor y guionista estadounidense.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (9, 'Neil Patrick Harris' , 'https://upload.wikimedia.org/wikipedia/commons/1/19/5.3.10NeilPatrickHarrisByDavidShankbone.jpg' , 'Estadounidense' , '1973-06-15' , 'Neil Patrick Harris es un actor, cantante, escritor, ilusionista, comediante y director estadounidense. Los papeles más destacados de su carrera incluyen el papel principal en Doogie Howser, M.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (10, 'Carrie Coon' , 'https://es.web.img3.acsta.net/pictures/14/06/25/14/26/052924.jpg' , 'Estadounidense' , '1981-01-14' , 'Carrie Alexandra Coon es una actriz estadounidense. Coon fue nominada a un premio Tony en 2012 por su actuación en la obra ¿Quién teme a Virginia Woolf?');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (11, 'Reika Kirishima' , 'https://static.wikia.nocookie.net/drama/images/5/51/KirishimaReika.jpg/revision/latest?cb=20181026163355&path-prefix=es' , 'Japonesa' , '1972-08-15' , 'Reika Kirishima  is a Japanese film and television actress active since 1997. Her first feature movie was Godzilla: Final Wars and first television show was Strawberry Night.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (12, 'Tōko Miura' , 'https://static.wikia.nocookie.net/tenkinoko1663/images/f/f3/Toko_Miura.png/revision/latest?cb=20201211231404' , 'Japonesa' , '1996-10-20' , 'Tōko Miura es una actriz y cantante japonesa. Es mejor conocida internacionalmente por su papel en la película Drive My Car del 2021, así como por su trabajo en la banda sonora de la película animada Weathering with You del 2019.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (13, 'Hidetoshi Nishijima' , 'https://static.wikia.nocookie.net/drama/images/b/bd/Nishijima_Hidetoshi_4.jpg/revision/latest?cb=20180909185443&path-prefix=es' , 'Japonesa' , '1971-03-29' , 'Hidetoshi Nishijima is a Japanese actor. He is widely regarded as one of Japans leading actors in numerous films and television drama series.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (14, 'Park Yu-rim' , 'https://m.media-amazon.com/images/M/MV5BY2FlMGNjN2UtMjYxYi00OWUzLTkzMDgtMmQzZWFlYWIyNjY1XkEyXkFqcGdeQXVyNTI5NjIyMw@@._V1_.jpg' , 'Surcoreana' , '1993-02-06' , 'sth geet wrong ... ');
