insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (16, 'Cho Yeo-jeong' , 'https://upload.wikimedia.org/wikipedia/commons/3/3a/Cho_Yeo-jeong.2019.jpg' , 'Surcoreana' , '1991-02-18' , 'Cho Yeo-jeong, es una actriz surcoreana. Conocida principalmente en el cine surcoreano por sus papeles principales en las películas de época The Servant y The Concubine, así como por protagonizar la serie de televisión I Need Romance.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (17, 'Park Seo-joon' , 'https://upload.wikimedia.org/wikipedia/commons/9/9d/20211203_Park_Seo-joon_%EB%B0%95%EC%84%9C%EC%A4%80_Photoshoot_for_Marie_Claire_Korea_%284%29.jpg' , 'Surcoreana' , '1988-12-16' , 'Theres no description');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (18, 'Park So-dam' , 'https://static.wikia.nocookie.net/drama/images/8/80/Park_So_Dam46.jpg/revision/latest?cb=20190603042456&path-prefix=es' , 'Surcoreana' , '1991-09-18' , 'Park So-dam es una actriz surcoreana, conocida en particular por su papel de Kim Ki-jung / Jessica en la película Parasite.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (19, 'Jung Ji-so' , 'https://static.wikia.nocookie.net/drama/images/5/51/Jung_Ji_So10.jpg/revision/latest?cb=20191218164807&path-prefix=es' , 'Surcoreana' , '1999-09-17' , 'Hyun Seung-min conocida profesionalmente como Jung Ji-so, es una actriz y expatinadora artística surcoreana. Es conocida internacionalmente sobre todo por su personaje Park Da-hye en la película Parasite.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (20, 'Song Kang-ho' , 'https://images.mubicdn.net/images/cast_member/4878/cache-146625-1607415235/image-w856.jpg?size=800x' , 'Surcoreana' , '1940-12-31' , 'Song Kang-ho es un actor surcoreano. Se graduó de la Universidad Busan Kyungsang con una licenciatura en radiodifusión, pero comenzó su carrera en grupos de teatro sin preparación profesional como actor. Hizo su debut en 1991 en la obra Dongseung.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (21, 'Keanu Reeves' , 'https://media.gq.com.mx/photos/5f57d52d4464f9b88fb26729/3:4/w_1500,h_2000,c_limit/Keanu-Reeves.jpg' , 'Canadiense' , '1964-09-02' , 'Keanu Charles Reeves es un actor y músico canadiense. Tiene sangre china por parte de su abuela.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (22, 'Carrie-Anne Moss' , 'https://www.themoviedb.org/t/p/w500/xD4jTA3KmVp5Rq3aHcymL9DUGjD.jpg' , 'Canadiense' , '1967-08-21' , 'Carrie-Anne Moss es una actriz canadiense que consiguió fama mundial tras sus apariciones en la saga The Matrix como Trinity');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (23, 'Laurence Fishburne' , 'https://static.wikia.nocookie.net/dcextendeduniverse/images/6/6b/Laurence_Fishburne.jpg/revision/latest?cb=20200928234100&path-prefix=es' , 'Estadounidense' , '1961-07-30' , 'Laurence John Fishburne III, más conocido como Laurence Fishburne, es un actor de cine estadounidense. Conocido principalmente por su rol como Morfeo en la película de ciencia ficción The Matrix y sus secuelas');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (24, 'Hugo Weaving' , 'https://www.themoviedb.org/t/p/w500/kkkZx3qoLA8oilMSCGT4soDqXPu.jpg' , 'Britanico-australiana' , '1960-04-04' , 'Hugo Wallace Weaving is an English actor. Born in Colonial Nigeria to English parents, he has resided in Australia for the entirety of his career.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (25, 'Marcus Chong' , 'https://static.wikia.nocookie.net/thecrow/images/d/d4/134F60D5-968B-4ABE-A3B6-B0542BE32BCA.jpeg/revision/latest?cb=20190713165903' , 'Estadounidense' , '1967-07-08' , 'Marcus Scott Chong es un actor estadounidense. Es conocido por interpretar a Miguel Méndez en el drama criminal de corta duración, Street Justice, al activista de la vida real Huey P. Newton en Panther, dirigida por Mario Van Peebles.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (26, 'Emma Stone' , 'https://upload.wikimedia.org/wikipedia/commons/3/31/Emma_Stone_at_Maniac_UK_premiere_%28cropped%29.jpg' , 'Estadounidense' , '1988-11-06' , 'Emily Jean Stone, más conocida profesionalmente como Emma Stone, es una actriz estadounidense. También ha incursionado en la producción cinematográfica.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (27, 'Ryan Gosling' , 'https://static.wikia.nocookie.net/doblaje/images/b/bf/Ryan-Gosling-Black-Hair-2015.jpg/revision/latest?cb=20160214020613&path-prefix=es' , 'Canadiense' , '1980-11-12' , 'Ryan Thomas Gosling es un actor y músico canadiense. También ha incursionado en la dirección y producción cinematográfica.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (28, 'J. K. Simmons' , 'https://static.wikia.nocookie.net/cine/images/f/ff/J.K._Simmons.jpg/revision/latest?cb=20150223183337' , 'Estadounidense' , '1955-01-09' , 'Jonathan Kimble Simmons, más conocido como J. K. Simmons, es un actor estadounidense ganador del Óscar, Globo de Oro, BAFTA, Premio del Sindicato de Actores, entre otros premios.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (29, 'John Legend' , 'https://static.wikia.nocookie.net/doblaje/images/0/0e/John_Legend.jpg/revision/latest?cb=20220822184545&path-prefix=es' , 'Estadounidense' , '1978-12-28' , 'John Roger Stephens, conocido como John Legend, es un cantante, compositor, pianista y actor estadounidense. Ha ganado once premios Grammy, un Premio Globo de Oro y un Oscar. En 2007, Legend recibió el Premio Hal David Starlight.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (30, 'Finn Wittrock' , 'https://flxt.tmsimg.com/assets/276756_v9_bb.jpg' , 'Estadounidense' , '1984-10-28' , 'Peter -Finn- Wittrock, Jr. es un actor y guionista estadounidense. Comenzó su carrera con papeles como invitado en varios programas de televisión, antes de hacer su debut en el cine en Twelve.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (31, 'Kate Winslet' , 'https://media.vogue.es/photos/607ed1366badb6988b205bf2/2:3/w_2560%2Cc_limit/GettyImages-97524191.jpg' , 'Britanica' , '1975-10-05' , 'Kate Elizabeth Winslet es una actriz británica de cine, televisión y teatro. Ha trabajado mayoritariamente en películas independientes, particularmente en dramas de época, y suele interpretar personajes complejos.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (32, 'Leonardo DiCaprio' , 'https://media.revistagq.com/photos/62ecd65ffb28d86a388289d6/2:3/w_720,h_1080,c_limit/Devil-in-the-white-city-keanu-reeves-Leonardo-dicaprio-Martin-scorsese.jpg' , 'Estadounidense' , '1974-11-11' , 'Leonardo Wilhelm DiCaprio es un actor, productor de cine y ambientalista estadounidense. Ha recibido numerosos premios entre los que destacan un Óscar al mejor actor; un premio BAFTA al mejor actor..');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (33, 'Billy Zane' , 'https://static.wikia.nocookie.net/arrow/images/9/9c/Billy_Zane.png/revision/latest?cb=20170621032241&path-prefix=es' , 'Estadounidense' , '1966-02-24' , 'William George Zane Jr. conocido como Billy Zane, es un actor y director estadounidense conocido por sus papeles en Titanic. ');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (34, 'Kathy Bates' , 'https://images.mubicdn.net/images/cast_member/23258/cache-725-1595703849/image-w856.jpg' , 'Estadounidense' , '1948-06-28' , 'Kathleen Doyle Bates, conocida artísticamente como Kathy Bates, es una actriz estadounidense de cine, televisión y teatro, ganadora de los premios Óscar, Globo de Oro, Emmy y SAG');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (35, 'Bill Paxton' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Bill_Paxton_in_July_2016_cropped_lighting_corrected_hue_correction.jpg/800px-Bill_Paxton_in_July_2016_cropped_lighting_corrected_hue_correction.jpg' , 'Estadounidense' , '1955-05-17' , 'William Archibald Paxton fue un actor y director de cine y televisión estadounidense. Paxton, uno de los secundarios ilustres de Hollywood. ');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (36, 'Daniel Radcliffe' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Daniel_Radcliffe_in_July_2015.jpg/640px-Daniel_Radcliffe_in_July_2015.jpg' , 'Britanica' , '1989-07-23' , 'Daniel Jacob Radcliffe es un actor británico, principalmente conocido por haber protagonizado la saga cinematográfica de Harry Potter. Fundamentalmente por ello, ha recaudado una fortuna de 23 millones de libras esterlinas.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (37, 'Emma Watson' , 'https://i.pinimg.com/originals/64/95/d0/6495d05033eb2029300f4a6fe5151952.jpg' , 'Britanica' , '1990-04-15' , 'Emma Charlotte Duerre Watson es una actriz, modelo y activista británica, conocida principalmente por haber interpretado el personaje de Hermione Granger en la saga de películas de Harry Potter.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (38, 'Rupert Grint' , 'https://media.revistagq.com/photos/5fac48293c41c2e74eae42e4/master/pass/GettyImages-651023044.jpg' , 'Britanica' , '1988-08-29' , 'Rupert Alexander Lloyd Grint es un actor inglés, conocido por interpretar a Ron Weasley en la serie de películas de Harry Potter.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (39, 'Alan Rickman' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/17/Alan_Rickman_at_BAM_-17.jpg/640px-Alan_Rickman_at_BAM_-17.jpg' , 'Britanica' , '1946-02-21' , 'Alan Sidney Patrick Rickman, conocido como Alan Rickman, fue un actor, director de cine y teatro y diseñador gráfico británico. Falleció el 14 de enero de 2016 en Londres.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (40, 'Ralph Fiennes' , 'https://images.mubicdn.net/images/cast_member/15458/cache-3877-1609422838/image-w856.jpg' , 'Britanica' , '1962-12-22' , 'Ralph Nathaniel Twisleton-Wykeham-Fiennes, conocido artísticamente como Ralph Fiennes, es un actor británico, nominado dos veces al premio Óscar.');
