insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (42, 'Lupita Nyongo' , 'https://upload.wikimedia.org/wikipedia/commons/3/34/SXSW_2019_4_%2847282558132%29_%28cropped%29.jpg' , 'Keniana y Mexicana' , '1983-03-01' , 'Lupita Amondi Nyongo más conocida como Lupita Nyongo, es una actriz mexicana-keniana de cine y televisión. Saltó a la fama en 2013 con su papel como Patsey en la película 12 años de esclavitud, del director británico Steve Rodney McQueen.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (43, 'Michael B. Jordan' , 'https://static.wikia.nocookie.net/doblaje/images/1/16/Michael_B._Jordan.png/revision/latest?cb=20191228022337&path-prefix=es' , 'Estadounidense' , '1987-02-09' , 'Michael Bakari Jordan, popularmente conocido como Michael B. Jordan, es un actor, director y productor estadounidense. Es conocido por interpretar al personaje de Erik Killmonger, el primo y enemigo de TChalla.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (44, 'Letitia Wright' , 'https://es.web.img3.acsta.net/pictures/19/04/25/23/54/1990890.jpg' , 'Britanica y Guyanesa' , '1993-10-31' , 'Letitia Michelle Wright es una actriz guyanesa-británica. Comenzó su carrera con papeles como invitada en las series de televisión Top Boy, Coming Up, Chasing Shadows, Humans, Doctor Who, y Black Mirror.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (45, 'Danai Gurira' , 'https://static.wikia.nocookie.net/doblaje/images/8/84/Danai_grira_2019.jpg/revision/latest?cb=20191006193413&path-prefix=es' , 'Estadounidense' , '1978-02-14' , 'Danai Jekesai Gurira es una actriz y dramaturga estadounidense-zimbabuense. Ha aparecido en diversos programas de televisión, películas y obras de teatro. Es más conocida por su papel como Michonne en la serie de televisión The Walking Dead.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (46, 'Andy Serkis' , 'https://es.web.img3.acsta.net/pictures/17/12/11/12/30/5609551.jpg' , 'Britanica' , '1964-04-20' , 'Andrew Clement Serkis es un actor, director de cine y escritor británico.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (47, 'Kristen Bell (Voz de Anna)' , 'https://static.wikia.nocookie.net/doblaje/images/d/df/Kristen_Bell_2019.jpg/revision/latest?cb=20191111181825&path-prefix=es' , 'Estadounidense' , '1980-07-18' , 'Kristen Anne Bell es una actriz estadounidense de cine y televisión, además de haberse desempeñado como actriz de teatro. Bell ha sido citada en los medios como una de las jóvenes que ha popularizado el estereotipo de chica geek.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (48, 'Idina Menzel (Voz de Elsa)' , 'https://static.wikia.nocookie.net/disney/images/e/e0/Idina_Menzel.jpg/revision/latest?cb=20201223195754' , 'Estadounidense' , '1971-05-31' , 'Idina Kim Menzel es una actriz y cantante estadounidense, especialmente conocida por interpretar a la Reina Elsa en la película de Disney de 2013 Frozen, además de interpretar la canción de la película en su versión oficial en inglés.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (49, 'Jonathan Groff (Voz de Kristoff)' , 'https://images.mubicdn.net/images/cast_member/21218/cache-170058-1600935533/image-w856.jpg?size=800x' , 'Estadounidense' , '1985-03-26' , 'Jonathan Drew Groff es un cantautor estadounidense de pop y actor de cine, teatro y televisión.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (50, 'Josh Gad (Voz de Olaf)' , 'https://www.themoviedb.org/t/p/w500/17iKlfWZBDTAucqjkhRKHr9xjIz.jpg' , 'Estadounidense' , '1981-02-23' , 'Joshua Ilan Gad, más conocido como Josh Gad, es un actor estadounidense famoso dar voz a Olaf en Frozen.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (51, 'Robert Downey Jr.' , 'https://e00-elmundo.uecdn.es/assets/multimedia/imagenes/2015/08/06/14388723698931.jpg' , 'Estadounidense' , '1965-04-04' , 'Robert John Downey Jr. es un actor, actor de voz, productor y cantante estadounidense.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (52, 'Josh Brolin' , 'https://flxt.tmsimg.com/assets/74371_v9_bc.jpg' , 'Estadounidense' , '1968-02-12' , 'Josh James Brolin es un actor de cine y televisión estadounidense. Su primer papel fue en la película Los Goonies en 1985.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (53, 'Chris Hemsworth' , 'https://upload.wikimedia.org/wikipedia/commons/e/e8/Chris_Hemsworth_by_Gage_Skidmore_2_%28cropped%29.jpg' , 'Australiana' , '1983-08-11' , 'Christopher Hemsworth, conocido simplemente como Chris Hemsworth, es un actor, actor de voz y productor australiano.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (54, 'Chris Evans' , 'https://static.wikia.nocookie.net/disney/images/b/b7/ChrisEvans.png/revision/latest?cb=20150201170140&path-prefix=es' , 'Estadounidense' , '1981-06-13' , 'Christopher Robert Evans, conocido simplemente como Chris Evans, es un actor, actor de voz, director y productor de cine estadounidense. Criado en el pueblo de Sudbury, mostró interés a temprana edad por la actuación y se mudó a Nueva York.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (55, 'Scarlett Johansson' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/6/60/Scarlett_Johansson_by_Gage_Skidmore_2_%28cropped%29.jpg/1200px-Scarlett_Johansson_by_Gage_Skidmore_2_%28cropped%29.jpg' , 'Estadounidense' , '1984-11-22' , 'Scarlett Ingrid Johansson es una actriz, cantante, directora, productora, modelo, cantante y empresaria estadounidense. Comenzó a mostrar intereses en la actuación desde temprana edad.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (56, 'Benedict Cumberbatch' , 'https://media.revistagq.com/photos/5ca5fcf9f46488360df4a04f/3:4/w_675,h_900,c_limit/benedict_cumberbatch_8437.jpg' , 'Britanica' , '1976-07-19' , 'Benedict Timothy Carlton Cumberbatch, conocido como Benedict Cumberbatch, es un actor británico de televisión, teatro, cine y voz.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (57, 'Tom Holland' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/3/3c/Tom_Holland_by_Gage_Skidmore.jpg/1200px-Tom_Holland_by_Gage_Skidmore.jpg' , 'Britanica' , '1996-06-01' , 'Thomas Stanley Holland, conocido simplemente como Tom Holland, es un actor, actor de voz y bailarín británico. Comenzó su carrera en el teatro en 2008 interpretando al personaje principal en el musical Billy Elliot.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (58, 'Mark Ruffalo' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/1/11/Mark_Ruffalo_%2836201774756%29_%28cropped%29.jpg/1200px-Mark_Ruffalo_%2836201774756%29_%28cropped%29.jpg' , 'Estadosunidense' , '1967-11-22' , 'Mark Alan Ruffalo es un actor, actor de voz, productor y director estadounidense. Inició su carrera como actor en los años 1990 apareciendo en varias series de televisión y películas con papeles menores.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (59, 'Chris Pratt' , 'https://upload.wikimedia.org/wikipedia/commons/thumb/9/99/Chris_Pratt_2018.jpg/800px-Chris_Pratt_2018.jpg' , 'Estadounidense' , '1979-06-21' , 'Christopher Michael Pratt conocido simplemente como Chris Pratt, es un actor, actor de voz y productor estadounidense. Aunque nació en Virginia, creció en la ciudad de Washington y tras terminar la secundaria en 1997, abandonó sus estudios.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (60, 'Bryce Dallas Howard' , 'https://m.media-amazon.com/images/M/MV5BNzExZDkyNWItMDYzNS00MGVlLTllZTctMjYyZGE1MmY0MThhXkEyXkFqcGdeQXVyMDA4NzMyOA@@._V1_.jpg' , 'Estadounidense' , '1981-03-02' , 'Bryce Dallas Howard es una actriz, guionista y directora estadounidense. Howard asistió a la Tisch School of the Arts de la Universidad de Nueva York; yéndose inicialmente en 2002 para asumir papeles en Broadway.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (61, 'Nick Robinson' , 'https://static.wikia.nocookie.net/doblaje/images/1/1e/Nick-robinson_sc_768x1024.png/revision/latest?cb=20150614232518&path-prefix=es' , 'Estadounidense' , '1995-03-22' , 'Nicholas John Robinson es un actor estadounidense. De niño, apareció en las producciones teatrales de 2008 de A Christmas Carol y Mame, y luego actuó en la serie de televisión Melissa & Joey.');
