insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (63, 'BD Wong' , 'https://flxt.tmsimg.com/assets/6863_v9_bb.jpg' , 'Estadounidense' , '1960-10-24' , 'Bradley Darryl Wong es un actor estadounidense.');
insert into ACTOR_ENTITY (id, nombre, fotografia, nacionalidad, fecha_nacimiento, biografia) values (64, 'Daisy Ridley' , 'https://static.wikia.nocookie.net/esstarwars/images/2/20/Daisy_Ridley_2.jpg/revision/latest?cb=20190518222747' , 'Britanica' , '1992-04-10' , '"Daisy Jazz Isobel Ridley es una actriz inglesa, famosa por interpretar al personaje de Rey en la tercera trilogía de Star Wars.');
